  return (
    <div>
      <h1>Welcome to the Teacher Data</h1>
      <Router>
        <Switch>
          <Route exact path="/" component={TeacherForm} />
          <Route path="/teachers" component={TeacherList} />
          <Route path="/teacher/:id" component={TeacherDetails} />
          <Route path="/teacher/edit/:id" component={EditTeacherForm} />
        </Switch>
      </Router>



    </div>
  );
}

export default App;
